CREATE DEFINER=`root`@`localhost` FUNCTION `calcular_dias_alquiler`(
    p_id_alquiler INT
) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE dias INT;

    SELECT DATEDIFF(a.fecha_fin, a.fecha_inicio) + 1
    INTO dias
    FROM alquileres a
    INNER JOIN inquilinos_generales i ON a.id_inquilino = i.id_inquilino
    WHERE a.id_alquiler = p_id_alquiler
      AND i.tipo_inquilino = 'TEMPORAL';  -- Solo considera alquileres temporales

    RETURN dias;
END ;;
