CREATE DEFINER=`root`@`localhost` FUNCTION `calcular_monto_expensa_total`(
    p_id_depto INT, 
    p_mes INT, 
    p_anio INT
) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
    DECLARE total DECIMAL(10,2);

    SELECT 
        e.monto + IFNULL(e.monto_extra,0) + IFNULL(SUM(g.monto),0)
    INTO total
    FROM expensas e
    LEFT JOIN gastos_detallados g ON e.id_expensa = g.id_expensa
    WHERE e.id_depto = p_id_depto
      AND e.mes = p_mes
      AND e.anio = p_anio
    GROUP BY e.id_expensa;

    RETURN total;
END ;;
